<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Raw Score to Percentile Calculator</title>
    <style>
        body {
            font-family: monospace, Arial, sans-serif;
            margin: 20px;
            background-color: #f9f9f9;
            color: #333;
        }
        h1 {
            text-align: center;
            color: #4CAF50;
        }
        .dropdowns {
            display: flex;
            gap: 20px;
            justify-content: center;
        }
        label {
            font-weight: bold;
        }
        select {
            padding: 5px;
            font-size: 16px;
        }
        .test-section {
            margin-top: 20px;
            background: white;
            border-radius: 8px;
            box-shadow: 0 2px 5px rgba(0, 0, 0, 0.2);
            padding: 20px;
        }
        .test-header {
            display: flex;
            justify-content: space-between;
            align-items: center;
            margin-bottom: 20px;
            background-color: white;
            padding: 10px;
            position: sticky;
            top: 0;
            z-index: 1000; /* Ensure it stays on top of other elements */
            box-shadow: 0 2px 5px rgba(0, 0, 0, 0.2); /* Optional: Add shadow for better visibility */
        }
        .test-header h2 {
            color: #4CAF50;
        }
        .test-header button {
            padding: 10px 20px;
            font-size: 16px;
            font-weight: bold;
            color: white;
            background-color: #4CAF50;
            border: none;
            border-radius: 4px;
            cursor: pointer;
            transition: background-color 0.3s;
        }
        .test-header button:hover {
            background-color: #45a049;
        }
        #tests {
            display: flex;
            flex-direction: row;
            flex-wrap: wrap;
            justify-content: space-between;
            /* gap: 20px; */
        }
        .test-row {
            max-width: 30%;
            display: flex;
            justify-content: space-between;
            align-items: center;
            padding: 10px 20px;
            border-bottom: 1px solid #e0e0e0;
        }
        .test-row:last-child {
            border-bottom: none;
        }
        .test-row .test-name-span {
            background-color: rgb(245, 245, 245);
        }
        .test-row span {
            width: 200px;
            font-weight: bold;
        }
        .test-row input {
            padding: 5px;
            font-size: 16px;
            width: 100px;
            border: 1px solid #ccc;
            border-radius: 4px;
        }
        .percentile {
            width: 200px;
            text-align: right;
            color: #007BFF;
            font-weight: bold;
        }
        .footer {
            text-align: center;
            margin-top: 30px;
            font-size: 14px;
            color: #555;
        }
        .test-bottom-button {
            display: flex;
            justify-content: center;
            margin-top: 20px;
        }
        .test-bottom-button button {
            padding: 10px 20px;
            font-size: 16px;
            font-weight: bold;
            color: white;
            background-color: #4CAF50;
            border: none;
            border-radius: 4px;
            cursor: pointer;
            transition: background-color 0.3s;
        }
    </style>
</head>
<body>

    <h1>Raw Score to Percentile Calculator</h1>

    <!-- Dropdowns -->
    <div class="dropdowns">
        <div>
            <label for="gender">Gender:</label>
            <select id="gender">
                <option value="M">Male</option>
                <option value="F">Female</option>
            </select>
        </div>
        <div>
            <label for="ageRange">Age Range:</label>
            <select id="ageRange">
                <option value="16-30">16-30</option>
                <option value="31-50">31-50</option>
                <option value="51-65">51-65</option>
            </select>
        </div>
        <div>
            <label for="education">Education:</label>
            <select id="education">
                <option value="IL">Illiterate</option>
                <option value="SE">School Educated</option>
                <option value="CE">College Educated</option>
            </select>
        </div>
    </div>

    <!-- Test Section -->
    <div class="test-section">
        <!-- <div class="test-header">
            <h2>Enter Raw Scores</h2>
            <button onclick="calculatePercentiles()">Calculate Percentiles</button>
        </div> -->
        <div class="test-header">
            <div style="display: flex; align-items: center;">
                <h2>Enter Raw Scores</h2>
                <input
                    type="text"
                    id="searchBox"
                    placeholder="Search tests..."
                    oninput="filterTests()"
                    style="padding: 5px; font-size: 16px; width: 200px; margin-left: 20px;"
                />
            </div>
            <button onclick="calculatePercentiles()">Calculate Percentiles</button>
        </div>
        <div id="tests"></div>
    </div>

    <div class="test-bottom-button">
        <button onclick="calculatePercentiles()">Calculate Percentiles</button>
    </div>
    <div class="footer">
        Developed by Tejendra Singh (Clinical Psychologist) and Sumit Yadav
    </div>

        "DSST", "CT-1", "CT-2", "DVT", "DVT-E", "COWA", "ANT", "NB-1H", "NB-1E", "NB-2H", "NB-2E", "DS", "SS", "TOL-2MT", "TOL-2MM", "TOL-2NMM", "TOL-3MT", "TOL-3MM", "TOL-3NMM", "TOL-4MT", "TOL-4MM", "TOL-4NMM", "TOL-5MT", "TOL-5MM", "TOL-5NMM", "TOL-NMM", "WCST-NOT", "WCST-NE", "WCST-PNE", "WCST-PR", "WCST-PPR", "WCST-PE", "WCST-PPE", "WCST-NPE", "WCST-PNPE", "WCST-TTCC1", "WCST-FMS", "WCST-NCR", "WCST-CLR", "WCST-PCLR", "WCST-NCC", "STROOP", "AVLT-T1", "AVLT-T2", "AVLT-T3", "AVLT-T4", "AVLT-T5", "AVLT-TOTAL", "AVLT-LB", "AVLT-IR", "AVLT-DR", "AVLT-LTPR", "AVLT-HITS", "AVLT-MISSES", "AVLT-FA", "LM1TS", "LM2TS", "LMPR", "LMREC", "VR1", "VR2", "VRPR", "CFT-COPY", "CFT-IR", "CFT-DR"
    ];

    const testsWithReverseScoring = [
        "DSST", "CT-1", "CT-2", "DVT", "DVT-E", "NB-1E", "NB-2E", "TOL-2MT", "TOL-2MM", "TOL-3MT", "TOL-3MM", "TOL-4MT", "TOL-4MM", "TOL-5MT", "TOL-5MM", "WCST-NOT", "WCST-NE", "WCST-PNE", "WCST-PR", "WCST-PPR", "WCST-PE", "WCST-PPE", "WCST-NPE", "WCST-PNPE", "WCST-TTCC1", "WCST-FMS", "STROOP", "AVLT-MISSES", "AVLT-FA"
    ];

    // Populate test rows
    const testsDiv = document.getElementById("tests");
    testNames.forEach(test => {
        const testRow = document.createElement("div");
        testRow.className = "test-row";
        testRow.innerHTML = `
            <span class="test-name-span">${test}:</span>
            <input type="number" id="rawScore-${test}" placeholder="Raw Score">
            <span class="percentile" id="percentile-${test}"></span>
        `;
        testsDiv.appendChild(testRow);
    });

    // Function to calculate percentiles
    function calculatePercentiles() {
        const gender = document.getElementById("gender").value;
        const ageRange = document.getElementById("ageRange").value;
        const education = document.getElementById("education").value;

        testNames.forEach(test => {
            const rawScoreInput = parseInt(document.getElementById(`rawScore-${test}`).value);
            const percentileElement = document.getElementById(`percentile-${test}`);

            // Retrieve the relevant dataset
            if (jsonData[test] && jsonData[test][gender] && jsonData[test][gender][ageRange] && jsonData[test][gender][ageRange][education]) {
                const scoreData = jsonData[test][gender][ageRange][education];
                const scores = Object.keys(scoreData).map(Number).sort((a, b) => a - b);

                if (scores.includes(rawScoreInput)) {
                    // Exact Match
                    const percentile = scoreData[rawScoreInput];
                    percentileElement.textContent = `${percentile}${percentile <= 15 ? '*' : ''}`;
                } else {
                    // Non-exact Match
                    const lower = scores.filter(score => score < rawScoreInput).pop();
                    const upper = scores.find(score => score > rawScoreInput);

                    if (lower !== undefined && upper !== undefined) {
                        let lowerPercentile = scoreData[lower];
                        let upperPercentile = scoreData[upper];

                        if (lowerPercentile !== undefined && typeof lowerPercentile === "string") {
                            lowerPercentile = lowerPercentile.split(" - ")[1];
                        }
                        if (upperPercentile !== undefined && typeof upperPercentile === "string") {
                            upperPercentile = upperPercentile.split(" - ")[0];
                        }

                        if (lowerPercentile > upperPercentile) {
                            let temp = lowerPercentile;
                            lowerPercentile = upperPercentile;
                            upperPercentile = temp;
                        }

                        percentileElement.textContent = `${lowerPercentile}${lowerPercentile <= 15 ? '*' : ''} - ${upperPercentile}${upperPercentile <= 15 ? '*' : ''}`;
                    } else if (lower !== undefined) {
                        if (testsWithReverseScoring.includes(test)) {
                            let lowerPercentile = scoreData[lower];

                            if (lowerPercentile !== undefined && typeof lowerPercentile === "string") {
                                lowerPercentile = lowerPercentile.split(" - ")[1];
                            }

                            percentileElement.textContent = `< ${lowerPercentile}${lowerPercentile <= 15 ? '*' : ''} (Below Lowest Range)`;
                        } else {
                            let lowerPercentile = scoreData[lower];

                            if (lowerPercentile !== undefined && typeof lowerPercentile === "string") {
                                lowerPercentile = lowerPercentile.split(" - ")[1];
                            }

                            percentileElement.textContent = `> ${lowerPercentile}${lowerPercentile <= 15 ? '*' : ''} (Above Highest Range)`;
                        }
                    } else if (upper !== undefined) {
                        if (testsWithReverseScoring.includes(test)) {
                            let upperPercentile = scoreData[upper];

                            if (upperPercentile !== undefined && typeof upperPercentile === "string") {
                                upperPercentile = upperPercentile.split(" - ")[1];
                            }

                            percentileElement.textContent = `> ${upperPercentile}${upperPercentile <= 15 ? '*' : ''} (Above Highest Range)`;
                        } else {
                            let upperPercentile = scoreData[upper];

                            if (upperPercentile !== undefined && typeof upperPercentile === "string") {
                                upperPercentile = upperPercentile.split(" - ")[0];
                            }

                            percentileElement.textContent = `< ${upperPercentile}${upperPercentile <= 15 ? '*' : ''} (Below Lowest Range)`;
                        }
                    } else {
                        percentileElement.textContent = "Not Found";
                    }
                }
            } else {
                percentileElement.textContent = "No Data";
            }

            if (percentileElement.textContent.includes('*')) {
                    percentileElement.style.color = "red";
            } else if (percentileElement.textContent.includes("No")) {
                percentileElement.style.color = "lightgray";
            } else {
                percentileElement.style.color = "blue";
            }
        });
    }

    function filterTests() {
        const keyword = document.getElementById("searchBox").value.toLowerCase();
        const testRows = document.querySelectorAll(".test-row");

        testRows.forEach(row => {
            const testName = row.querySelector(".test-name-span").textContent.toLowerCase();
            if (testName.includes(keyword)) {
                row.style.display = "flex"; // Show matching tests
            } else {
                row.style.display = "none"; // Hide non-matching tests
            }
        });
    }
    </script>
